import React from 'react';
import './Home.css';
import { Button } from 'reactstrap';

export default function Home() {
  return (
    <div>
      <h1 className="TitleText">¡Bienvenidos a la cosa!</h1>
      <Button color="info">¿Que es "La cosa"?</Button>
    </div>
  )
}
